const BookingsList=({bookings})=>{

   const bookingNodes=bookings.map((booking)=>{
    return(<Booking name={booking.name} email={booking.email} booked={booking.checked_in}/> )

    })




return(
    <>
    {bookingNodes}
    </>

    )


};
export default BookingsList;
